import * as React from 'react';
import { View, Text, StyleSheet, Button, ScrollView, FlatList, ListRenderItemInfo } from 'react-native';

import { CoffeeHeader } from "../../components/CoffeeHeader/CoffeeHeader";
import { CoffeeItem } from "../../components/CoffeeItem";
import { SeparatorItem } from "../../components/SeparatorItem/SeparatorItem";
import { Coffee, coffeeList } from '../../data/coffeeList';


export default function HomeScreen({navigation}) {
  function renderItem({ item }: Li <Coffee>) {
    return <CoffeeItem {...item} />;
  }
  return (
    <View style={styles.container}>
      <FlatList
        ListHeaderComponent={CoffeeHeader}
        ItemSeparatorComponent={SeparatorItem}
        data={coffeeList}
        keyExtractor={(item) => item.name}
        renderItem={renderItem}
      />
    </View>
  );
}
const styles = StyleSheet.create({
  text :{ 
    color: '#552583',
    fontSize: 20,
    fontWeight: '',
    
  },
});
